Defendant Paul M McNeil in court with attorney Mark A. Pecora.  William T. Berens appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:

AS TO COUNT 02:
The Court imposed but stayed 9 months at the House of Correction, with credit for 4 days time served, and placed defendant on probation for two (2) years.

AS TO COUNT 04:
The Court imposed but stayed 9 months at the House of Correction, consecutive to Count 2, and placed defendant on probation for two (2) years concurrent to probationary period in Count 2.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with Ayesha K.;
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens;
 - Parenting counseling;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Serve 30 days condition time with good time and Huber release;
 - Pay the costs and disbursements by the end of probationary period.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

Court ordered defendant remanded to begin serving condition time.

Filed,
Letter of support of defendant;
Pretrial Incarceration Credit;
Notice of Right to Seek Postconviction Relief.
